<!doctype html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(62.729305, 49.586788);
			ctx.lineTo(5.0, 49.5);
			ctx.stroke();

			// #path5
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(62.826011, 49.561769);
			ctx.lineTo(95.029141, 49.5079);
			ctx.stroke();

			// #path6
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(94.776393, 34.552786);
			ctx.lineTo(64.776393, 49.552786);
			ctx.lineTo(94.776393, 64.552786);
			ctx.stroke();

			// #path8
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(63.158359, 35.0);
			ctx.lineTo(63.158359, 65.0);
			ctx.stroke();
		</script>
	</body>
</html>
